  return (
    <div className="App bg-slate-950 min-w-52 w-full h-screen flex justify-start items-center flex-col">

      <div className='fixed h-screen w-full flex justify-center items-center'>
        <img src={logoback} alt="****" className='blur-md'/>
      </div>

      <section className='w-11/12 pt-6 pb-6 z-0 flex justify-between items-center'>
        <img src={goldisc} alt="" className='xl:w-24 sm:w-20 w-16 animate-spinlow' />

        <nav className='text-white font-game xl:text-2xl sm:text-xl text-lg'>
          <a href="gle.com/" className='mr-8 hover:underline hover:animate-pulse decoration-purple-600 underline-offset-4 decoration-2'>HIRE</a>
