        </nav>
      </section>

      <section className='bg-slate-600 z-0 w-11/12 h-full gap-5 flex justify-center items-center'>
        <div className='bg-orange-500 w-full h-full'>
          <div>
            <img src={bannerpc} alt="" />
          </div>
          <p></p>
        </div>

        <div className=' bg-orange-500 w-full h-full'>dsadas</div>
      </section>

    </div>
  );
}

export default App;
